// atob() is used to convert base64 encoded PDF to binary-like data.
// (See also https://developer.mozilla.org/en-US/docs/Web/API/WindowBase64/
// Base64_encoding_and_decoding.)
var pdfData = atob('');

// Loaded via <script> tag, create shortcut to access PDF.js exports.
var { pdfjsLib } = globalThis;
// get references to the canvas and context
var canvas = document.getElementById("the-canvas");
var context = canvas.getContext("2d");
var overlay = document.getElementById('the-overlay');
var overlayContext = overlay.getContext('2d');
var grid = document.getElementById('the-grid');
var gridContext = grid.getContext('2d');
var offsetX=canvas.offsetLeft;
var offsetY=canvas.offsetTop;
// The workerSrc property shall be specified.
pdfjsLib.GlobalWorkerOptions.workerSrc = 'pdf.worker.mjs';

// Using DocumentInitParameters object to load binary data.
var loadingTask = pdfjsLib.getDocument({data: pdfData});
loadingTask.promise.then(function(pdf) {
  console.log('PDF loaded');

  // Fetch the first page
  var pageNumber = 1;
  pdf.getPage(pageNumber).then(function(page) {
    console.log('Page loaded');

    var scale = 2;
    var viewport = page.getViewport({scale: scale});

    // Prepare canvas using PDF page dimensions
    canvas.height = viewport.height;
    canvas.width = viewport.width;
    overlay.height = viewport.height;
    overlay.width = viewport.width;
    grid.height = viewport.height;
    grid.width = viewport.width;
    

    
    // Render PDF page into canvas context
    var renderContext = {
      canvasContext: context,
      viewport: viewport
    };
    var renderTask = page.render(renderContext);
    renderTask.promise.then(function () {
      console.log('Page rendered');
    })
    .then(function(result){
      var bw = grid.width, bh = grid.height, p = 0;
      console.log( gridContext.width);
      for (var x = 0; x <= bw; x += 12) {
          gridContext.moveTo(0.5 + x + p, p);
          gridContext.lineTo(0.5 + x + p, bh + p);
      }
    
      for (var x = 0; x <= bh; x += 12) {
        gridContext.moveTo(p, 0.5 + x + p);
        gridContext.lineTo(bw + p, 0.5 + x + p);
      }
      gridContext.strokeStyle = "white";
      gridContext.stroke();
    });
  });
}, function (reason) {
  // PDF loading error
  console.error(reason);
});


// this flage is true when the user is dragging the mouse
var isDown = false;

// these vars will hold the starting mouse position
var startX,startY, mouseX, mouseY;


function handleMouseDown(e) {
    e.preventDefault();
    e.stopPropagation();
    
    const target = e.target;

    // Get the bounding rectangle of target
    const rect = target.getBoundingClientRect();

    // Mouse position
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;

    // save the starting x/y of the rectangle
    startX = x;
    startY = y;

    // set a flag indicating the drag has begun
    isDown = true;
}

function handleMouseUp(e) {
    e.preventDefault();
    e.stopPropagation();

    // the drag is over, clear the dragging flag
    isDown = false;
}

function handleMouseOut(e) {
    e.preventDefault();
    e.stopPropagation();

    // the drag is over, clear the dragging flag
    isDown = false;
}

function handleMouseMove(e) {
    e.preventDefault();
    e.stopPropagation();

    // if we're not dragging, just return
    if (!isDown) {
        return;
    }

    // get the current mouse position
    const target = e.target;

    // Get the bounding rectangle of target
    const rect = target.getBoundingClientRect();

    // Mouse position
    const x = e.clientX - rect.left;
    const y = e.clientY - rect.top;
    // Put your mousemove stuff here
    mouseX = x;
    mouseY = y;
    // clear the canvas
    overlayContext.clearRect(0, 0, canvas.width, canvas.height);

    // calculate the rectangle width/height based
    // on starting vs current mouse position
    var width = mouseX - startX;
    var height = mouseY - startY;

    // draw a new rect from the start position 
    // to the current mouse position
    overlayContext.strokeRect(startX, startY, width, height);

}
// listen for mouse events
overlay.addEventListener("mouseup", handleMouseUp, false);
overlay.addEventListener("mousedown", handleMouseDown, false);
overlay.addEventListener("mousemove", handleMouseMove, false);
overlay.addEventListener("mouseout", handleMouseOut, false);

